import React from 'react';
import CategoryItem from './CategoryItem';

const CategoryList = ({ catalog = [] }) => {
    return (
        <>
            {catalog.map((el) => (
                <CategoryItem key={el.idCategory} {...el} />
            ))}
        </>
    );
};

export default CategoryList;
